import React, { useEffect, useState } from 'react';
import {
    Dialog,
    DialogContent,
    DialogTitle,
    Typography,
    Chip,
    DialogContentText,
} from '@mui/material';
export default function ApptDialog({ selectedStartTimes, docId,doctorUniqId, id, dialogOpen, handleCloseDialog, selectedDate, doctorsAvailability, setSelectedStartTime, handleBooking }) {
console.log(docId);
    const [getDoctors, setGetdoctors] = useState({})

    useEffect(() => {
        const AllDoctors = doctorsAvailability?.find((e) => e.doctorId === docId)
        setGetdoctors(AllDoctors);
    
      }, []);

      const descriptionElementRef = React.useRef(null);
      React.useEffect(() => {
        if (open) {
          const { current: descriptionElement } = descriptionElementRef;
          if (descriptionElement !== null) {
            descriptionElement.focus();
          }
        }
      }, [open]);

  
    return (
        <div>





 
<Dialog
        open={open}
        onClose={handleClose}
        scroll={scroll}
        aria-labelledby="scroll-dialog-title"
        aria-describedby="scroll-dialog-description"
      >
        <DialogTitle id="scroll-dialog-title">Subscribe</DialogTitle>
        <DialogContent dividers={scroll === 'paper'}>
          <DialogContentText
            id="scroll-dialog-description"
            ref={descriptionElementRef}
            tabIndex={-1}
          >
            {[...new Array(50)]
              .map(
                () => `Cras mattis consectetur purus sit amet fermentum.
Cras justo odio, dapibus ac facilisis in, egestas eget quam.
Morbi leo risus, porta ac consectetur ac, vestibulum at eros.
Praesent commodo cursus magna, vel scelerisque nisl consectetur et.`,
              )
              .join('\n')}
          </DialogContentText>
        </DialogContent>

      </Dialog>


            {/* <Dialog open={dialogOpen} onClose={handleCloseDialog} minWidth="md" fullWidth >
                <DialogTitle style={{ fontSize: '15px', fontWeight:"550" }}>Dr.{getDoctors.doctorName}</DialogTitle>
        <p>{getDoctors.specialist}</p>
                <DialogContent>
                    <Typography variant="body2" style={{ color: "grey" }}>Selected Date: {selectedDate}</Typography>
                    <Typography variant="body2" style={{ color: "grey" }}>Available Start Times:</Typography>
                    {selectedStartTimes.map((startTime, index) => (
                        <Chip
                            key={index}
                            label={startTime}
                            variant="outlined"
                            color="primary"
                            className="mt-2"
                            onClick={() => {
                                setSelectedStartTime(startTime);
                                handleBooking(doctorUniqId, id);
                            }}
                        />
                    ))}
                </DialogContent>
            </Dialog> */}
        </div>
    );
}



